import React, { Component } from 'react';

class Navbar extends Component{
    render(){
        return(
            <nav className="navbar bg-dark">
                <img src={this.props.logo} alt="kebab" style={{width: "10%", marginLeft: "1%"}}/>
            </nav>
        );
    }
}

export default Navbar;
